import React, { useState, useEffect } from 'react';
import { Col, Row, Badge, Card, Button, Modal } from "react-bootstrap";
import AgentService from "../services/AgentService";

function AgentsComponentFunction() {

    const [agents, setAgents] = useState({});

    useEffect(() => {
        var data;
        AgentService.getAgents().then((response) => {
            data = response.data;
        });
        return () => {
            setAgents(data);
            console.log(agents);
            console.log("agents= " + typeof (agents));
        };
    }, []);

    return (
        <div>

            <h2>Vav√°, tomar no cu</h2>
            <Row xs={1} md={2} lg={3}>
            </Row>

        </div>
    )
}

export default AgentsComponentFunction
